INSERT INTO `upb_carrera` (`idupb_carrera`, `idupb_plantel`, `carrera`, `porque`, `perfil`, `areas`, `director`, `cargo`) VALUES
(1, 0, 'Ingeniería Petrolera y Gas Natural', '<p>La importancia que tiene el sector hidrocarburífero en el desempeño socio económico del país brinda inmejorables oportunidades para participar activamente en el sector productivo de mayor dinamismo, desafío que exige una formación altamente calificada que garantice el desarrollo eficiente y seguro de las operaciones de perforación, producción ingeniería de reservorios, transporte y almacenamiento, refinación y comercialización del petróleo y gas natural.</p>\r\n', '<p>El Ingeniero Petrolero de formación bilingüe es un profesional capacitado para:</p>\r\n<p><span id="point"></span>Realizar el diseño de proyectos de ingeniería básica y de detalle para cada uno de los sectores que conforman la cadena de la industria petrolera.</>\r\n<p><span id="point"></span>Ejecutar, evaluar y supervisar proyectos con elevado nivel de solvencia técnica y uso de herramientas computacionales de nueva generación, aplicando técnicas de gestión modernas respetando políticas de calidad, medioambiente, seguridad, higiene ocupacional y responsabilidad social de las empresas.</p>\r\n<p>Participar y dirigir equipos de trabajo en cada uno de los sectores de la industria petrolera.</p>\r\n<p><span id="point"></span>Desarrollar actividades de ingeniería e investigación en las distintas áreas de actividad de la industria de hidrocarburos.</p>', '<p>El Ingeniero Petrolero puede desempeñarse en:</p>\r\n<p>Labores de planificación del sector hidrocarburífero estableciendo metas y estrategias que que permitan la atención de las demandas de los mercados internos y de los compromisos de exportación tanto de energía primaria como derivados.</p>\r\n<p>La operación y dirección de diferentes actividades que se cumplen en la industria petrolera, tanto en el sector de la administración pública como privada.</p>\r\n<p>El desempeño de un liderazgo eficaz en los proyectos para los sectores de perforación, producción, ingeniería de reservorios, transporte y almacenamiento, refinación y comercialización de hidrocarburos.</p>\r\n<p>Diversas labores de gestión en asesoría técnica, supervición, fiscalización y de otros servicios.</p>', 'Mgr. Rafael Valdez Zegarra', 'Jefe de Carrera de Ingeniería Petrolera y Gas Natural'),
(2, 0, 'Ingenieria de la Producción ', '<p>Porque es una ingeniería de procesos industriales y está involucrada con el diseño, instalación, operación y optimización de sistemas de transformación, orientadas a generar un valor agregado sopbre materias primas e insumos, para conseguir productos y servicios que satisfagan plenamente los requerimientos de clientes.</p>\r\n<p>Los Ingenieros de las Producción pueden desempeñarse en organizaciones industriales, comerciales, y de servicios, tanto en asesoria instituional como en el diseño y gestión de los sistemas de producción.</p>', '<p>El licenciado de Ingeniería de la Producción bilingue con formación técnica y diciplinaria, enfocado a los procesos de producción a los procesos de producciónde bienes tangibles e intangibles, capaz de comprender los componentes técnicos, ambientales, financieros y humanos que conforman una operación de producción.</p>\r\n<p><span id="point"></span>El Inegeniero de Producción tiene habilidades profesionales para:\r\n<p>Combinar el manejo de los recursos naturales, humanos. financieros, tecnológicos y sociales con el entorno de los procesos.</p>\r\n<p><span id="point"></span>Conciliar las operaciones de producción con los requerimientos, restricciones y cambios continuos operantes en nuestros dias.</p>\r\n<p><span id="point"></span>Diseñar, instalar, operar, controlar y optimizar los sistemas productivos o de transformación.</p>\r\n<p>Diseñar e implementar planes y sistemas integrados de gestión de calidad, medio ambiente, inocuidad y seguridad industrial.</p>\r\n<p><span id="point"></span>Elaborar, evaluar e implementar proyectos de inversión.</p>\r\n<p><span id="point"></span>Adaptarse a condicines exigentes de trabajo, con habilidad para tomar decisiones y asumir retos.</p>', '<p>Por su formación técnica y gerencial y la continua circulación de la teoría con la práctica, es emprendedor y está capacitado para desempeñarse tanto en planta como en posiciones directivas en:</p>\r\n<p>Industrias manufactureras (alimentos y bebidas, cuero, vidrio, papel, cemento, minería, madera, metálica, metal mecánica, petroquímica, industrias químicas, biotecnológicas, farmacéuticas, cosméticas entre otras).</p>\r\n<p>Organizaciones comerciales y de servicio en el ámbito nacional e internacional (Universidades, bancos, consultoras, empresas de telecomunicaciones, de servicios básicos, de mantenimiento entre otras).</p>\r\n<p>Industria y servicios de logística y transformación petrolera.</p>\r\n<p>Instituciones públicas tanto a nivel nacional como internacional, en las áreas de desarrollo, producción, energía, medio ambiente, tecnología, patentes entre otras, así como trabajador independiente, como consultor y/o en el emprendimiento de su propio negocio.</p>\r\n<p>CIPI y CIAAA<p/>\r\n<p>Centros de Investigaciones</p>\r\n<p>Docentes y estudiantes de Ingeniería de la Producción están fuertemente vinculados con las actividades de investigación desarrolladas en el Centro de Investigación de Procesos Industriales (CIPI) y en el centro de investigación Agrícolas Andinas (CIAAA).</p> \r\n<p>El CIPI tiene como objetivo mejorar la competitividad de empresas industriales bolivianas a través de la investigación en: </p>\r\n<p>(a) El desarrollo de procesos industriales y desarrollo de productos de valor agregado aprovechando la biodiversidad boliviana.</p>\r\n<p>(b) El desarrollo y aplicación de procesos de Producción Más Limpia (PML).</p>\r\n<p>(c) Eficiencia energética.</p>\r\n<p>El CIAAA se ha creado con el propósito de contribuir al mejoramiento de la calidad de vida de pequeños productores agrícolas del altiplano, mediante investigaciones aplicadas, capacitación transferencia y Tecnología.</p>', 'Elizabeth Mirian Torres Santa Cruz, Ph.D.c.', 'Jefe de Carrera de Ingeniería de la Producción'),
(3, 0, 'Ingeniería Industrial y de Sistemas', '<p>Porque la competencia global, el uso de tecnologías de información y la innovación de productos y servicios inducen a las empresas a buscar nuevos enfoques estructurados para el mejoramiento de su desempeño integrando esfuerzos para incrementar su valor.</p>\r\n<p>La utilización de herramientas analiticas y enfoques estructurados facilita la toma de decisiones en el área de la Ingeniería Industrial y de Sistemas permitiendo optimizar procesos productivos, sistemas logísticos, sistemas de manufactura, implementar sistemas de aseguramiento de la calidad asumiendo responsabilidad, sentido crítico, ética y valores.</p>', '<p>El Ingeniero Industrial y de Sistemas es un profesional bilingüe con base sólida en matemáticas y especializado en la optimización de recursos de un organización manufacturera o de prestación de servicios. Está capacitado para: </p>\r\n<p><span id="point"></span>Modelar, analizar y mejorar productos, procesos y servicios aplicando herramientas de la Ingeniería Industrial y de Sistemas.</p>\r\n<p>Diseñar y conducir experimentos para el desarrollo de un producto o proceso.</p>\r\n<p><span id="point"></span>Integrar da la tecnología computacional en sistemas productivos y de servicio.</p>\r\n<p><span id="point"></span>Diseñar e implementar de sistemas de calidad.</p>\r\n<p><span id="point"></span>Diseñar y gestionar las operaciones logísticas y de la cadena de suministro.</p>\r\n<p><span id="point"></span>Optimizar procesos utilizando metodologías que aplican las tecnologías de información para administrar eficientemente la complejidad de las nuevas cadenas productivas.</p> \r\n<p><span id="point"></span>Preparar, evaluar y gestionar proyectos de inversión.</p>', '<p>Los trabajos que realizará estarán orientados a analizar, diseñar e implementar procesos, productos o sistemas que aseguren la generación de mayores beneficios económicos, personales y sociales de la organización.</p>\r\n<p>El Ingeniero Industrial y de Sistemas puede desempeñarse en.</p>\r\n<p>Empresas manufactureras, de servicio, gubernamentales y educativas entre otras.</p>\r\n<p>Como consultor asesorando a empresas.</p>\r\n<p>Creando su propia empresa.</p>\r\n', 'Mgr. Fernando López Magne', 'Jefe de Carrera de Ingeniería Industrial y de Sistemas'),
(4, 0, 'Ingeniería Electrónica y Telecomunicaciones', '<p>Esta industria se ha convertido en uno de los principales contribuyentes a la economía de cualquier país.</p>\r\n<p>La evolución actual en este campo permite a los seres humanos la posibilidad de intercambiar información al instante donde la distancia es un factor de escasa importancia, porque la tecnología ha conseguido que tal costo de la comunicación sea bajo y accesible para casi todo el mundo.</p>', '<p>El Ingeniero electrónico y de telecomunicaciones es un profesional bilingüe que recibe una formación exclusiva en el campo académico e investigativo. Fundamentalmente destacado por el manejo de las nuevas tecnologías existentes como ser las plataformas NGN (Next Generation Network) y dominio en áreas de tecnología óptica como son los lasers y fibras ópticas.</p>\r\n<p><span id="point"></span>Nuestros profesionales obtienen altísimo nivel de preparación a través de una educación con excelencia académica basada en la investigación, también se adaptan a los cambios tecnológicos en esta sociedad que necesita de una comunicación más efectiva y rápida.</p>\r\n<p><span id="point"></span>Adicionalmente al título académico nuestros graduados adquieren una certificación técnica (MIIKROTIC) sobre plataformas NGN, a través de TX Bolivia SRL en el área de Telecomunicaciones. Este tipo de certificado es exigido en el mercado laboral de Bolivia para garantizar la calidad de l ingeniero en telecomunicaciones. La carrera de Ingeniería Electrónica y Telecomunicaciones dispone de un plan de estudios efectivo que involucra niveles de aprendizaje enfocados a:</p>\r\n<p>1. Sistemas Telemáticos</p>\r\n<p>2. Radioelectrónica</p>\r\n<p>3. Mecanismos de control en robótica</p>\r\n<p>4. Programación de servicios y circuitos de control</p>\r\n<p>5. Microcontroladores</p>\r\n<p>6. Sensores en sistemas electrónicos y circuitos de control</p>\r\n<p>7. Aplicaciones en redes IT Backbone - IP</p>\r\n<p>8. Opto-electrónica y láseres</p>\r\n<p>9. Plataformas NGN (Next Generation Network)</p>', '<p>El Ingeniero electronico y de telecomunicaciones puede desempeñarse en:</p>\r\n<p>Planificación e implementación de redes de transporte de voz, video, datos y multimedia por medios fisicos, radio-propagación y en redes IP.</p>\r\n<p>Operación de servicios en telecomunicaciones, planificación y gestión en instituciones privadas y gubernamentales de equipamiento electronico digital y redes de telecomunicacines.</p>\r\n<p>Diseño e implenetación de plataformas NGN.</p>\r\n<p>Desarrollo de plataformas digitales educativas y aplicaciones técnicas en: electrónica digital para redes de alimentación, centrales telefónicas digitales, sistemas satelitales, redes ópticas y gestión de tráfico.</p>\r\n<p>Diseño e implementación de sistemas electrónicos en radio-aviónica.</p>\r\n<p>Gestión y control de aeronavegación por sitemas de radar.</p>', 'Omar Ormachea, Ph.D.', 'Jefe de Carrera de Ingeniería Electrónica y Telecomunicaciones'),
(5, 0, 'Ingeniería de Sistemas Computacionales', '<p>Porque esta carrera ofrece un programa de desarrollo para satisfacer las más exigentes demandas de un mercado globalizado, La UPB garantiza que nuestros profesionales graduados cuentan con el conocimiento, la visión y la actitud necesarios, para encarar los desafíos de la vida profesional. Para alcanzar esta meta se combina de manera equilibrada la teoría con la práctica, Ésta la realizan en los laboratorios de la UPB y participando en proyectos reales que demandan las empresas de nuestro medio.</p>', '<p>El Ingeniero de Sistemas Computacionales, es un profesional bilingüe capacitado para:</p>\r\n<p><span id="point"></span>Administrar sistemas informáticos y desarrollar aplicaciones a medida del cliente en diferentes campos.</p>\r\n<p><span id="point"></span>Integrar las Nuevas Tecnologías en Informática y Computación (NTIC) en los procesos industriales y administrativos de empresas e instituciones.</p>\r\n<p><span id="point"></span>Mantenerse actualizado para dar dinamismo a su empresa en el ámbito tecnológico y proyectandola a la vanguardia del desarrollo nacional y mundial.</p>', '<p>El Ingeniero de Sistemas Computacionales Puede desempeñarse en los siguientes ámbitos:</p>\r\n<p>Local y Nacional: empresas públicas o privadas e industrias que requieran de instrumentos y herramientas tecnológicas.</p>\r\n<p>Internacional: empresas que soliciten el servicio de terceros (off-shore) para atender sus requerimientos. Bolivia es una plaza privilegiada, contando con varias empresas de este género que tienen clientes en los Estados Unidos y Europa.</p>\r\n<p>Crear su propia empresa, con proyección local, nacional o internacional: el espíritu emprendedor que se desarrolla en la carrera, le permite identificar oportunidades de desarrollo.</p>\r\n<p>Participar de proyectos de investigación, desarrollo e innovación, en el área de las Tecnologías de la Información o como componente informático de proyectos multidisciplinarios.</p>\r\n<p>CINTI</p>\r\n<p>CENTRO DE INVESTIGACIONES DE NUEVAS TECNOLOGÍAS INFORMÁTICAS</p>\r\n<p>El CINTI se ha creado con el objetivo de realizar investigaciones sobre nuevos paradigmas de programación y desarrollo de software para facilitar el uso de recursos computacionales distribuidos, a todo tipo de usuarios (con o sin conocimiento de programación).</p>\r\n<p>En el CINTI se ha implementado un cluster (o conjunto de varias computadoras interconectadas, que dan la ilusion de ser una sola con mucha mas capacidad de cálculo) que será interconectado a redes científicas intenacionales. Técnicas modernas e innovadoras (como ser, arquitecturas web y orientadas a servicios sistemas multi-core, programacion orientada a aspectos, sistemas distribuidos basados en Grid/Cloud computig) serán utilizadas por en  CINTI en sus investigaciones.</p>\r\n<p>El CINTI se posicionará como un centro de triple competencia: Técnica, alicada y de investigación.</p>\r\n<p>(a) Técnica: Implementando y desarrollando nuevas tecnologías IT que serán puestas a disposición de la comunidad universitaria (estudiantes, docentes e investigadores) e industria, por medio de seminarios y otro tipo de eventos.</p>\r\n<p>(b) Aplicada: Dando soporte a la comunidad universitaria e industria, para el uso de los recursos computacionales distribuidos para la realización de simulaciones, alnálisis y/o cálculos intensivos aplicados.</p>\r\n<p>(c) Investigación: Posicionando a la UPB en la comunidad cientifica internacional pro medio de la elaboración y participación de proyectos científicos y la publicación de sus investigaciones en conferencias internacionales de renombre.</p>\r\n', 'Mgr. Luis Marcel Barrero Mendizábal', 'Jefe de Carrera de Ingeniería de Sistemas Computacionales'),
(6, 0, 'Ingeniería Civil', '<p>Hay una gran demanda de Ingenieros Civiles en todo el mundo, porque existe la necesidad de mantener, subsistir o actualizar una infraestructura.</p> \r\n<p>Adquieren sólidos conocimientos en Ingeniería de Estructuras y Geotecnia, Ingeniería Hidráulica, Ingeniería Sanitaria y Ambiental, Ingeniería de carreteras, Gerencia y Supervisión de Obras Civiles.</p>\r\n<p>Es una carrera creativa, versátil y útil, no importa el ramo de la ciencia que a uno le agrade, siempre se encuentra una especialidad y una aplicación en Ingeniería Civil.</p>\r\n<p>Son construcciones que permanecen en el tiempo y es muy gratificante poder verlas en el futuro.</p>', '<p>El Ingeniero Civil es un profesional capacitado para:</p>\r\n<p><span id="point"></span>Participar en la vida productiva ya sea en la iniciativa privada o en instituciones del gobierno relacionadas con el proyecto, diseño construcción y mantenimiento de infraestructura u obra particular.</p>\r\n<p><span id="point"></span>Crear su propia empresa.</p>\r\n<p><span id="point"></span>Alcanzar un gran impacto social ambiental con las obras en que participe desempeñándose en ética y espíritu de servicio para contribuir al bienestar social de las comunidades.</p>', '<p>El INgeniero Civil tiene una sólida base en ciencias físicas y matemáticas, adquiere conocimiento científico y tecnológico con la experiencia y práctica le permite:</p>\r\n<p>Formular propuestas técnicas y económicas para participar en las licitaciones de obras públicas y privadas.</p>\r\n<p>Aplicar normas nacionales e internacionales par el control de calidad de los materiales utilizados en la construcción, considerando como parámetros la seguridad, durabilidad y economía.</p> \r\n<p>Realizar estudios de factibilidad técnico-económicos y diseño final de  proyectos de obras civiles.</p>\r\n<p>Vincularse directamente al diseño, construcción y mantenimiento de obras de infraestructura y de instalaciones de servicios para la comunidad.</p>\r\n<p>Impartir docencia en el ámbito de la educación superior e investigación.</p>\r\n', 'Francisco Aguirre Torrico, Ph.D.', 'Jefe de Carrera de Ingeniería Civil'),
(7, 2, 'Ingeniería Financiera', '<p>Porque la carrera de Ingeniería financiera forma profesionales que gestionan eficazmente el dinero y las inversiones de las organizaciones y personas, siendo que la administración exitosa de las finanzas es uno de los pilares fundamentales para asegurar el crecimiento sostenible de una empresa y aportar al desarrollo del país. </p>\r\n\r\n<p>El Ingeniero Financiero domina las herramientas tecnológicas de la informática, de la simulación y la modelación, toma decisiones de inversión, financiamiento y dividendos en entornos cambiantes y sujetos a múltiples restricciones y busca maximizar el valor de las empresas.</p>', '<p>La UPB te ofrece: </p>\r\n<p><span id="point"></span>Formación profesional de excelencia con un modelo de aprendizaje intensivo y de altos resultados.</p>\r\n<p><span id="point"></span>Plan de estudios diseñado de acuerdo a las necesidades del país y del mundo actual.</p>\r\n<p><span id="point"></span>Plantel docente con estudios doctorales y grado de maestría que combinan teoría con su experiencia laboral en clases</p>\r\n<p>La posibilidad de adquirir experiencia a través de prácticas empresariales en instituciones de nuestro medio.</p> \r\n<p><span id="point"></span>Visión internacional a partir del dominio de otros idiomas y oportunidades para realizar intercambios con universidades del extranjero.</p>\r\n<p><span id="point"></span>Ser un profesional líder en puestos clave de empresas del sector público y privado.</p>\r\n<p><span id="point"></span>Desenvolverte en una cultura emprendedora que impulsa la generación de empresas.</p>', '<p>Al ser los recursos financieros necesarios en todo tipo de organizaciones, trabajarás en empresas industriales, comerciales o de servicios tanto del sector público como privado, desempeñando funciones como:</p>\r\n<p>Gerente General.</p>\r\n<p>Gerente Financiero.</p>\r\n<p>Gerente de Costos.</p>\r\n<p>Jefe de Tesoreria.</p>\r\n<p>Ejecutivo de Cuentas en corredoras de bolsa, bancos, cooperativas, etc. </p>\r\n<p>Si tienes inclinación por ser un profesional independiente puedes trabajar como:</p>\r\n<p>Analista bursátil y corredor de bolsa en el Mercado de Valores.</p>\r\n<p>Consultor financiero y evaluador de proyectos.</p>\r\n<p>Consultor de Riesgos.</p>', 'Mgr. Juan José Jordán Sánchez', 'Jefe de Carrera de Ingeniería Financiera'),
(8, 0, 'Arquitectura', '<p>La solución de los problemas que plantea el hábitat sin duda, ha constituido siempre uno de los desafíos más importantes en la evolución de las sociedades en sus diferentes niveles.</p>\r\n<p>Hoy en día debemos enfrentarnos a los efectos del cambio climático y la contaminación de las ciudades, diseño arquitectónica y urbano deben estar en armonía con el medio ambiente.</p>\r\n<p>La inquietud de responder a esos problemas con imaginación, solvencia, seguridad y responsabilidad, mediante el diseño Arquitectónica, Urbano y la Planificación Territorial.</p>', '<p>El arquitecto formando en la UPB, esta capacitado para:</p>\r\n<p><span id="point"></span>Desarrollar con creatividad y solvencia proyectos arquitectónicos de diferentes escalas y complejidades. </p>\r\n<p><span id="point"></span>Desarrollar proyectos de planificación territorial, diseños urbanos y paisajísticos.</p>\r\n<p><span id="point"></span>Utilizar los recursos técnicos que garanticen la ejecución de los proyectos en condiciones acordes al entorno y sus contextos sociales, económicos, históricos, culturales y ambientales, así como a las disposiciones y normas legales existentes.</p> \r\n<p><span id="point"></span>Interpretar la realidad nacional y local en sus aspectos culturales y ambientales relevantes para responder eficientemente a las demandas individuales y colectivas de la sociedad en los campos de su competencia.</p>\r\n<p><span id="point"></span>Realizar la planificación, diseño y ejecución de las obras civiles de las instituciones públicas o privadas, complementando su capacidad profesional con una sólida formación que lo capacita para desenvolverse a nivel de consultor particular o público.</p> ', '<p>El conocimiento adquirido permite al Arquitecto graduado de la UPB desempeñar trabajos en:</p>\r\n<p>Práctica privada o profesional independiente</p>\r\n<p>Estudios de arquitectura y diseño</p> \r\n<p>Estudios de urbanismo y paisajismo</p>\r\n<p>Estudios de restauración y rehabilitación patrimonial</p> \r\n<p>Empresas constructoras</p>\r\n<p>Consultoras de planificación</p>\r\n<p>Peritajes y avalúos</p>\r\n<p>Cargos públicos</p>\r\n<p>Gastion en oficinas del gobierno y municipios</p>\r\n<p>Investigación </p>\r\n<p>Investigador en diferentes áreas: tecnología de  la construcción, urbanismo, políticas de vivienda, etc. </p>', 'Mgr. Bernardo Agustín Cabrerizo Barrientos', 'Jefe de Carrera de Arquitectura'),
(9, 0, 'Comunicación', '<p>Es la carrera que forma profesionales que van a diseñar y dirigir las políticas corporativas de comunicación y que facilita a la empresas y personas transmitir, a través de los medios de comunicación y de las tecnologías de las información, la imagen de que sean sea percibida por el público. </p>\r\n<p>El comunicador corporativo es el responsable de diseñar y desarrollar la imagen de las organizaciones hacia el mercado, así como la de sus ejecutivos o de una persona que necesite tener perfil público. Desarrolla competencias de relacionamiento y comunicación, empatía, innovación liderazgo dominio tecnológico de medios, análisis del entorno y tendencias en el futuro. </p>', '<p>¿Porque en la UPB?:</p>\r\n<p><span id="point"></span>Diferenciarte en el mercado laboral como especialista en comunicación empresarial. \r\n<p>Ejercitar la dirección de comunicación (DIRCOM) en las empresas.</p>\r\n<p><span id="point"></span>Desarrollar tus habilidades comunicativas y de liderazgo.</p>\r\n<p><span id="point"></span>Convertirse en estratega de comunicación empresarial y análisis de tendencias.</p>\r\n<p>Desarrollar tu espíritu emprendedor para que, si lo deseas, trabajes en tu propio negocio. </p>\r\n<p><span id="point"></span>Ingresar al mundo empresarial con prácticas y pasantías en las más importantes empresas del país.</p> \r\n<p>Participar en congresos, concursos y conferencias nacionales e internacionales.</p>\r\n<p>Realizar viajes de estudio y de trabajo al interior y exterior de país. </p>\r\n<p><span id="point"></span>Ser miembro de redes nacionales e internacionales, como la Association of Image Consultants International (AICI) y la Asociación Uruguaya de  Asesores de Imagen y Personal Shoppers.</p>\r\n<p><span id="point"></span>Dominar el idioma inglés al graduarte.</p>', '<p>Cargos directivos y ejecutivos en empresas nacionales e internacionales.</p> \r\n<p>Creación y dirección de empresa propia especializada en relaciones.</p> \r\n<p>Consultoría y asesoría en imagen corporativa y personal, política, del ámbito privado y público, en los departamentos de comunicación corporativa, recursos humanos, tecnología, servicio al cliente e imagen empresarial. públicas, organización de eventos, diseño y publicidad, auditoria de imagen corporativa y estrategia de comunicación. experto en manejo de medios y control de crisis institucionales.</p>', 'Mgr. Martín Arandia Raimondeau', 'Jefe de Carrera de Marketing y Logística y Comunicación'),
(10, 3, 'Marketing y Logística', '<p>La carrera de Marketing y Logística forma profesionales que se anticipan y responden en corto plazo a las cambiantes necesidades de los consumidores en un mercado de productos y servicios muy dinámico que exige estrategias de alta competitividad a las empresas.</p>\r\n<p>El profesional de Marketing y Logística de la UPB diseña e implementa planes estratégicos y operativos de marketing para facilitar la toma de decisiones y mejorar la posición competitiva del producto o servicio en el mercado.</p>', '<p>¿Porque en la UPB?</p>\r\n<p><span id="point"></span>Desarrollar tus habilidades directivas y de liderazgo</p>\r\n<p><span id="point"></span>Convertirte en un estratega innovador y proactivo</p>\r\n<p><span id="point"></span>Darte a conocer en el mundo empresarial a través de las prácticas y trabajos aplicados en las más importantes empresas del país</p>\r\n<p><span id="point"></span>Participar con frecuencia en congresos  y conferencias nacionales e internacionales</p>\r\n<p><span id="point"></span>Realizar viajes de estudio y trabajo, tanto en el interior como en el exterior del país</p>\r\n<p><span id="point"></span>Ser miembro del único capítulo universitario de la AMA (American Marketing Association – U.S.A.)</p>\r\n<p><span id="point"></span>Fomentar tu espíritu emprendedor para que puedas abrir tu propio negocio</p>\r\n<p><span id="point"></span>Formarte como Director, Gerente o Jefe en el área de Marketing</p>', '<p>Cargos directivos y ejecutivos en empresas nacionales e internacionales, tanto en el ámbito privado y público, en los departamentos de marketing, servicio al cliente y ventas</p>\r\n<p>Asumir funciones de supervisión y jefaturas de ventas en empresas que comercializan productos de consumo masivo</p>\r\n<p>Encargarse del diseño y ejecución de investigaciones de mercado</p>\r\n<p>Diseñar y ejecutar estrategias de comunicación</p>\r\n<p>Independizarte creando tu empresa especializada en estudios de mercado, estrategias comerciales, planes de marketing, planes comerciales, penetración de mercados internacionales, servicio al cliente campañas publicitarias y promocionales, desarrollo de productos</p>\r\n<p>Ejercer como consultor experto en marketing, servicio y ventas</p>\r\n<p>Administración de Empresas</p>', 'Mgr. Martín Arandia Raimondeau', 'Jefe de Carrera de Marketing y Logística y Comunicación'),
(11, 4, 'Administración de Empresas', '<p>Porque la administración permite desarrollar una empresa desde una simple idea de negocio, pasando por una empresa familiar, hasta consolidar una gran corporación. La administración aumenta la competitividad de la empresa y el valor del capital de los dueños.</p>\r\n<p>El Administrador de Empresas:</p>\r\n<p>Desarrolla la estrategia de la empresa</p>\r\n<p>Diseña la organización que permita conseguir la estrategia y selecciona al personal idóneo</p>\r\n<p>Dirige al personal y consigue su máximo de rendimiento</p>\r\n<p>Crea los sistemas de control que aseguren el cumplimiento de la estrategia</p>', '<p>La UPB te ofrece:</p>\r\n<p><span id="point"></span>Docentes exclusivos con grados doctorales y de maestría, dedicados a la investigación y ejercicio profesional de su especialidad</p>\r\n<p><span id="point"></span>Asesoramiento académico personalizado</p>\r\n<p><span id="point"></span>Uso exclusivo en clases de la metodología de casos desarrollada por el INCAE Business School</p>\r\n<p><span id="point"></span>Participar en consultoría de empresas a nivel sudamericano utilizando la metodología Business Management System (BMS) desarrollado por el Centro de Comercio Internacional</p>\r\n<p><span id="point"></span>Posibilidad de cursar en inglés materias de últimos semestres</p>\r\n<p><span id="point"></span>Intercambio estudiantil con universidades de Estados Unidos</p>\r\n<p><span id="point"></span>Prácticas profesionales en las principales empresas afiliadas a la Confederación de Empresarios Privados de Bolivia y la Federación de Entidades Empresariales Privadas de Cochabamba </p>\r\n<p><span id="point"></span>Participar en el Programa Emprendedor del Centro de Emprendimiento Empresarial (CEE) de la UPB para crear tu empresa y que tu plan de negocios te sirva como modalidad de titulación</p>\r\n<p><span id="point"></span>Desarrollar una red de contactos con los mejores profesionales y académicos de la especialidad</p>', '<p>Cargos directivos y ejecutivos en todas las empresas privadas buscando maximizar su valor</p>\r\n<p>Cargos ejecutivos en organizaciones públicas para maximizar el servicio social</p>\r\n<p>Consultor de empresas familiares asegurando la transferencia generacional</p>\r\n<p>Creando y desarrollando tu propia empresa</p>\r\n', 'Miguel Neil Hinojosa Alcócer, Ph.D.c.', 'Jefe de Carrera de Administración de Empresas'),
(12, 0, 'Diseño Gráfico', '<p>Porque las empresas necesitan diseñar marcas, definir la imagen corporativa, elaborar piezas gráficas, hacer publicidad, empaques, fotografía publicitaria y animaciones utilizando tecnología de punta.</p>\r\n<p>El Diseñador Gráfico puede transmitir ideas y enviar mensajes visualmente atractivos, desarrollar la identidad e imagen corporativa y asimismo desarrollar campañas publicitarias y promocionales.</p>', '<p>La UPB te ofrece:</p>\r\n<p><span id="point"></span>Plan de estudios diseñado de acuerdo a exigencias internacionales</p>\r\n<p><span id="point"></span>Una formación del más alto nivel académico con docentes especializados</p>\r\n<p><span id="point"></span>Sólidos conocimientos y prácticas en cada materia</p>\r\n<p><span id="point"></span>Alcanzar altos niveles de competencias en análisis, para realizar propuestas visuales de alto impacto</p>\r\n<p><span id="point"></span>La posibilidad de adquirir experiencia a través de prácticas empresariales en importantes empresas nacionales</p>\r\n<p><span id="point"></span>Desenvolverte en una cultura emprendedora que impulsa la generación de empresas</p>', '<p>Desempeñarse en agencias de publicidad</p>\r\n<p>Directores de arte</p>\r\n<p>En el departamento de Diseño Gráfico de empresas privadas y públicas</p> \r\n<p>Formar parte del equipo creativo en medios de comunicación diversos (periódicos, revistas, televisión)</p>\r\n<p>Independizarte creando tu empresa de Diseño Gráfico</p>', 'Mgr. Marcelo Canedo Doering', 'Jefe de Carrera de Diseño Gráfico'),
(13, 0, 'Ingeniería Comercial', '<p>Porque en virtud de los elevados niveles de exigencia laboral y el entorno competitivo global en el que vivimos, nuestros Ingenieros Comerciales son formados con estándares de excelencia mundial en el manejo de herramientas administrativas, técnicas, económicas, financieras y de dirección de empresas.</p>\r\n<p>Buscamos desarrollar el espíritu emprendedor de los estudiantes para que sean creadores de negocios y generadores de empleo.</p>\r\n<p>Formamos profesionales comprometidos con la problemática socioeconómica de su región y del país en general.</p>', '<p>La UPB te ofrece:</p>\r\n<p><span id="point"></span>Desarrollar una alta capacidad analítica, que te permita entender a los consumidores y sus diversos segmentos</p>\r\n<p><span id="point"></span>Desarrollar el pensamiento crítico, creativo e innovador que te permita fomentar una visión y actitud emprendedora estratégica</p>\r\n<p><span id="point"></span>Una formación en habilidades de liderazgo con una visión empresarial y humanista que trasciende la empresa y su acción</p>\r\n<p><span id="point"></span>Brindarte experiencia laboral a través de programas de prácticas empresariales en diferentes empresas tanto locales como nacionales</p>\r\n<p><span id="point"></span>Ser parte del Único Capítulo Universitario en Sudamérica de la American Marketing Association</p>\r\n<p><span id="point"></span>Actualizar tus conocimientos participando en congresos y seminarios de calidad internacional</p>\r\n<p><span id="point"></span>Estas actividades te permitirán tener una formación integral ligada a una visión de desarrollo, mejoramiento y competitividad de las organizaciones y de la sociedad.</p>', '<p>Creando, generando y desarrollando tu propia empresa</p>\r\n<p>Asumiendo funciones directivas, ejecutivas, de asesoría u operación técnica en diferentes departamentos de la empresa privada o pública</p>\r\n<p>Integrando equipos en departamentos de estudios commercial, financieros, relaciones humanas o de organización</p> \r\n<p>Ejerciendo libremente la profesión como consultor</p>', 'Mgr. Rommel Rojas ', 'Jefe de Carrera de Ingeniería Comercial'),
(14, 1, 'Derecho', '<p>Porque la carrera de derecho es una de las de mayor prestigio en el mundo universitario, por la importancia de formar profesionales que trabajan en base a las normas que regulan la acción de las personas, las organizaciones y los Estados.</p>\r\n<p>La profesión de abogado permite un desempeño profesional de amplio espectro, asociado con las tareas de crear, interpretar y aplicar normas jurídicas en el área de las empresas, las instituciones públicas, los Estados o los organismos internacionales, asesorando a personas e instituciones, previniendo conflictos legales o solucionándolos.</p>', '<p>la UPB te ofrece:</p>\r\n<p><span id="point"></span>Sólidos conocimientos y práctica en todas las áreas del derecho</p>\r\n<p>Alcanzar altos niveles de desarrollo en competencias de análisis, argumentación, comunicación y liderazgo.</p>\r\n<p><span id="point"></span>Desarrollar razonamiento jurídico y fortalecer tus bases éticas</p>\r\n<p><span id="point"></span>Aplicar técnicas modernas de resolución de conflictos</p>\r\n<p><span id="point"></span>Aprendizaje basado en la metodología de casos</p>\r\n<p><span id="point"></span>Practica de juicios orales en la sala especial de audiencias de la Universidad</p>\r\n<p>Formar parte de la consultora jurídica empresarial de la UPB, que ofrece servicios de consultoría y asesoramiento jurídico corporativo.</p>\r\n<p><span id="point"></span>Participar en le programa UPBufete, que te brinda oportunidad de practica permanente y trabajo en prestigiosos estudios jurídicos departamentales y nacionales.</p>', '<p>El abogado graduado de la UPB ejerce su profesión en distintos campos:</p>\r\n<p>Independientemente, mediante el ejercicio libre de la profesión, en todas sus áreas</p>\r\n Realizando consultorías y asesoramiento jurídico a empresas e instituciones, ya sean públicas o privadas (ámbito laboral, tributario, comercial, etc)\r\n<p>Administra justicia o defiende al Estado ejerciendo labores de juez o fiscal</p>\r\n<p>Soluciona controversias como árbitro o conciliador</p>\r\n<p>Representar a Bolivia ante organismos internacionales,  como Naciones </p>\r\n<p>Unidas, Comunidad Andina de Naciones, entre otras; aplicando los conocimientos de Derecho Internacional.</p>', 'Mgr. Laura Constanza García Sobral', 'Jefe de Carrera de Derecho'),
(15, 0, 'Economía', '<p>Porque esta carrera forma profesionales con el potencial de convertirse en los principales protagonistas del desarrollo de nuestra sociedad y de sus industrias.</p>\r\n<p>El economista es un profesional experto e el análisis y la toma de decisiones eficientes para alcanzar metas. Sus amplios conocimientos sobre la gestión de los recursos (financieros u otros) la administración de inversiones empresariales, el comportamiento humano y la organización de la sociedad, hacen del economista un profesional muy requerido y de muy alto prestigio.</p>', '<p>La UPB te ofrece:</p>\r\n<p><span id="point"></span>Una formación del más alto nivel académico internacional, que responda a las exigencias del mundo contemporáneo.</p>\r\n<p><span id="point"></span>Docentes con grado académico superior, amplia experiencia laboral y prestigio a nivel nacional e internacional, vinculados a actividades de investigación y consultoría en asuntos económicos y empresariales.</p>\r\n<p><span id="point"></span>Prácticas profesionales previas a la titulación en instituciones privadas, públicas y organismos internacionales.</p>\r\n<p><span id="point"></span>Vínculos con economistas de alto nivel nacional e internacional a través de talleres, videoconferencias, seminarios y prácticas</p>\r\n<p><span id="point"></span>Asociación a grupos especializados globales como AIESEC, que te permiten construir redes de contacto durante la carrera</p>\r\n<p><span id="point"></span>Formar parte del desarrollo de proyectos internacionales y consultorías especializadas llevadas a cabo por el prestigioso Centro de Investigaciones Económicas y Empresariales de la UPB</p>', '<p>El economista graduados de la UPB ejerce su profesión en:</p>\r\n<p>Centros de análisis económico</p>\r\n<p>Organismos Internacionales</p>\r\n<p>Gobiernos centrales, regionales o municipales</p>\r\n<p>Empresas consultoras y centros de investigación</p>\r\n<p>Organizaciones No Gubernamentales y Fundaciones para el desarrollo </p>\r\n<p>Asimismo, el amplio conocimiento de los economistas sobre flujos financieros, organizaciones de mercado, de industrias y empresas le abre las puertas para desempeñarse en cargos empresariales.</p>\r\n<p>Gerencia General</p>\r\n<p>Gerencia Financiera</p>\r\n<p>Gerencia Comercial</p>\r\n<p>Gerencia de riesgos en instituciones financieras</p>\r\n<p>Asesoría de inversiones y planificación estratégica</p>', 'Ricardo Nogales Carvajal, Ph.D.c.', 'Jefe de Carrera de Economía'),
(16, 0, 'Ingeniería Electromecánica ', '<p>Porque los grandes desafíos que enfrenta la industria nacional e internacional es \r\nel dominio de tecnologías de punta para lograr fabricar productos d alta calidad \r\ncon elevada productividad, siento esto posible sólo con la visión integradora del \r\nIngeniero Electromecánico.</p>\r\n<p>La carrera de Ingeniería Electromecánica desarrolla conocimientos y habilidades \r\nintegradas en robótica, mecatrónica, electricidad, electrónica, automatización, \r\nmecánica e informática.\r\n</p>', '<p>El Ingeniero Electromecánico es un profesional bilingüe que posee el \r\nconocimiento, tecnología, metodología y las habilidades para:</p>\r\n<p><span id="point"></span>Integrar tecnologías del área de robótica, electrónica, eléctrica, mecánica, \r\ncontrol y automatización de lo que se conoce hoy en día como Mecatrónica</p>\r\n<p><span id="point"></span>Diseñar y adaptar tecnologías con tendencia a la automatización \r\nde procesos de producción en bienes y servicios, para satisfacer las \r\nnecesidades de amplios sectores de la sociedad boliviana</p>\r\n<p><span id="point"></span>Estudiar, proyectar y ejecutar centrales generadoras, estaciones \r\ny subestaciones, transformadoras, líneas, redes de alimentación y \r\ndistribución de energía eléctrica</p>\r\n<p><span id="point"></span>Promover competencias humanas de liderazgo, proactividad, trabajo en \r\nequipo y flexibilidad para adaptarse rápidamente a cambios tecnológicos</p> \r\n<p><span id="point"></span>Analizar, diseñar, instalar y mantener sistemas electromecánicos</p>\r\n<p><span id="point"></span>Diseñar, optimizar y controlar los procesos de fabricación de máquinas, \r\npiezas, equipos, encaminados a la modernización de la industria</p>\r\n<p><span id="point"></span>Planificar y optimizar el mantenimiento en una organización industrial con \r\nénfasis en diagnóstico no destructivo, para minimizar los costos asociados</p>', '<p>El Ingeniero Electromecánico está capacitado para desempeñar actividades de \r\ningeniería y gerencia en:</p>\r\n<p>Generación, transmisión y distribución de energía eléctrica.</p>\r\n<p>Industrias manufactureras.</p>\r\n<p>Consultoría en servicios petroleros.</p>\r\n<p>Empresas de servicio de control y optimización de procesos industriales.</p>', 'Grover Zurita Villarroel, Ph.D.', 'Jefe de Carrera de Ingeniería Electromecánica');
