INSERT INTO `upb_plantel` (`idupb_plantel`, `nombre`, `grados_academicos`, `actividad_profesional`) VALUES
(1, '<p>Laura García</p>', '<p>Máster Internacional en Administración (MBA).</p>\r\n<p>Máster en Derecho de los Negocios Internacionales.</p>\r\n<p>Máster en Derecho Internacional Privado.</p>\r\n<p>Licenciada en Derecho, Magna cum Laude, Universidad Privada Boliviana.</p>', '<p>Actualmente desempeña los cargos de Jefe de Carrera de Derecho en la Universidad Privada Boliviana(Campus Cochabamba) y Directora de la Consultora Jurídica Empresarial. Asimismo, es socia del Estudio Jurídico Sobral & García Abogados Consultores.</p>\r\n<p>Anteriormente ejerció el cargo de Asesora Legal Comercial en la Empresa de Luz y Fuerza Eléctrica Cochabamba S.A.(ELFEC S.A.) Previamente ejerció funciones en el Estudio Jurídico Salinas Gamarra Abogados y en el Servicio de Impuestos Nacionales en la ciudad de La Paz.</p>\r\n<p>Afiliada al Colegio Nacional de Abogados de Bolivia, al Ilustre Colegio Departamental de Abogados de Cochabamba, \r\ny miembro de la Asociación de Mujeres empresarias y Profesionales (AMEP).<p/>'),
(8, 'Oscar Jorge Molina Tejerina, Ph.Dc', '<p>Oscar Molina, es Ph.D en Economía y Ciencias Sociales de la Universidad Politécnica de Valencia,Ph.D en Economía y Administración de Empresas de la Universidad Privada Boliviana,  M.A en Negocios y Comercio Internacional de la Universidad Privada Boliviana, M.Sc en Economía de la Universidad de Chile y Licenciado en Economía de la Universidad Católica Boliviana San Pablo.</p>', '<p>Fue Investigador del Departamento de Economía de la Universidad de Chile y del Fondo de Investigación Científica y Tecnológica de Chile. Trabajó como consultor Internacional para el Programa de Promoción de la Reforma Educativa en América Latina y el Caribe (PREAL), el Banco Interamericano de Desarrollo (BID), el Programa Mundial de Alimentos de las Naciones Unidas (PMA), la Unidad de Apoyo de Servicios de la Cooperación Canadiense (UASSC), el Banco Mundial y la Corporación Andina de Fomento.</p>\r\n<p>Fue Capacitador Internacional en Perú y Ecuador en Métodos Cuantitativos para la CAN y el Banco Mundial. En Bolivia, fue miembro del directorio de NAFIBO Sociedad de Titularización, consultor en temas de educación para el gobierno boliviano, Gerente Ejecutivo y Economista Senior de Grupo Integral S.R.L. y especialista sectorial en el Instituto Nacional de Estadística. En el área académica, fue Profesor invitado en programas de maestría en la Universidad Mayor de Andrés, en la Universidad Andina Simón Bolivia (Sucre), conferencista en diferentes congresos y encuentros académicos a nivel nacional e internacional, ha publicado diferentes artículos académicos en revistas indexadas a nivel nacional e internacional. En la UPB,  se desempeñó como Jefe de Carrera de Ingeniería Comercial, Decano de la Facultad de Ciencias Empresariales y Derecho, Decano del Campus La Paz y director de varios proyectos de la Unidad de Consultoría y pacitación.</p>\r\n<p>Actualmente es Vicerrector Académico del Campus La Paz, Director Académico del Doctorado en Economía, profesor de Microeconomía Avanzada del Doctorado, profesor titular de Estadística y Economía en pregrado, profesor de la Maestría en Administración y Dirección de Empresas (UPB – USACH), profesor de la Maestría de Administración de Empresas Tiempo Completo (INCAE – UPB), profesor de la Maestría en Negocios y Comercio Internacional (UPV - UPB), profesor de la Maestría en Derecho Económico y Empresarial (UPB) y Director Académico y Profesor de diferentes Diplomados en la UPB. Asimismo, es miembro del comité editor de la revista de investigación científica: Investigación & Desarrollo, investigador Asociado del Centro de Investigaciones Económicas y Empresariales (CIEE), investigador asociado del \r\nInstituteforAdvancedDevelopmentStudies (INESAD) y presidente de la Fundación INESAD.</p>'),
(2, '<p>Alejandro Vargas Sanchez</p>', '<p>PhD Student, Doctorado en Economía y Administración con énfasis en Economía:</p>\r\n<p>Universidad Privada Boliviana.</p> \r\n<p>Magíster en Administración y Dirección de Empresas con Especialidad en Finanzas:</p> \r\n<p>Tecnológico de Monterrey y la Escuela Militar de Ingeniería.</p>\r\n<p>Licenciado en Administración de Empresas: Universidad Mayor de San Andrés.</p>\r\n', '<p>En su estadía en la UPB además de ser Jefe de la Carrera de Ingeniería Financiera en la ciudad de La \r\nPaz,  es el Director de tres (3) programas de Post Grado en las áreas de Gestión de Riesgos, Banca y \r\nFinanzas y Mercado de Valores; asimismo forma parte del Instituto de Investigación en Economía y \r\nEmpresa (CIEE) de la UPB en calidad de investigador en Mercados e Instituciones Financieras, también \r\nes miembro del Comité de Inversiones en un Fondo de Inversión Cerrado administrado por la SAFI \r\nMercantil Santa Cruz. Cuenta con amplia experiencia profesional en el área financiera y en evaluación \r\nde proyectos, habiendo realizando trabajos para entidades como la Bolsa Boliviana de Valores S.A., \r\nFundación MEDMIN, Ready Mix S.A., Mineral Processing S.R.L., también participó como consultor en \r\nproyectos financiados por el Banco Mundial y el Banco Interamericano de Desarrollo.</p>\r\n'),
(3, '<p>Rebeca Sarmiento</p>', '<p>Licenciatura en Administración de Empresas, Virginia, Estados Unidos.\r\n<p>Maestría en Educación, Boston Estados Unidos.\r\n<p>Especialidad: </p>\r\n<p>Dentro del Departamento de Inglés se especializa en el diseño y coordinación del programa de inglés \r\nEPAS (English Study for Academic Purpose) para el campus La Paz; además de la preparación para \r\npruebas internacionales del idioma Inglés, contratación, capacitación y evaluación de los docentes de los \r\ndiferentes niveles, y actualización del material para el programa EPAS.</p>\r\n', '<p>Dentro de la Universidad Privada Boliviana se desempeña como Jefa de Carrera de Marketing y \r\nLogística y Jefa del Departamento de Educación General desde el año 2004. Docente de planta \r\nde inglés en los diferentes niveles desde el año 2003. Coordinadora del Programa de Capacitación \r\ny Fortalecimiento docente del plantel académico desde el año 2008.</p> \r\n\r\n<p>Actualmente dicta cursos en Diplomados, Maestrías y cursos cortos para el sector público en \r\nComunicación, Recursos Humanos y Desarrollo Personal.</p>'),
(4, '<p>Miguel Neil Hinojosa Alcócer Ph.D.c.</p>', '<p>Jefe de Carrera de Administración de Empresas</p>\r\n<p>Docente de materias administrativas y contables en Pre y Post grado.</p>\r\n<p>Conferencista Internacional y Nacional.</p>\r\n<p>Candidato a Doctor en Administración de Empresas y Economía, Universidad de Sevilla.</p>\r\n', '<p>Certificado Internacional Gestión de Compras y de la Cadena de Suministros.</p>\r\n<p>International Trade Centre.</p>\r\n<p>Master en Administración de Empresas, Universidad Privada Boliviana.</p>\r\n<p>Diplomado en Educación, Mención Gestión Educativa, Universidad Privada Boliviana.</p>\r\n<p>Diplomado en Contabilidad y Finanzas Corporativas, Universidad Privada Boliviana.</p>\r\n<p>Licenciado en Auditoria, Universidad Mayor de San Simón.</p>\r\n'),
(5, '<p>Jacques Martín Arandia Raimondeau</p>', '<p>Master en Dirección en Marketing y Ventas</p>\r\n<p>Master en Gestión de Eventos Corporativos</p>\r\n<p>Diplomado en Venta Personalizada</p>\r\n<p>Diplomado en Imagen Empresarial y Personal</p>\r\n<p>Jefe de las Carreras de Marketing & Logística y Comunicación</p>\r\n<p>Docente de Pregrado y Postgrado de la UPB</p>', '<p>Socio de la agencia de eventos MiSoluttio Meeting Planner</p>\r\n<p>Socio de la distribuidora de lubricantes JARAND</p>\r\n<p>ExAsesor en Posicionamiento del Directorio del Club de Tenis Cochabamba</p>\r\n<p>ExConsultor de la Fundación “Libertador Bolívar” empresa emprendedora en parques temáticos</p>\r\n<p>ExGerente General del Centro Internacional de Convenciones (CIC)</p>\r\n<p>ExAsesor y Consultor Comercial de “Alas del Sur” y NUEVATEL</p>\r\n'),
(6, '<p>Juan Antonio Fernández León, M.SC.</p>', '<p>Máster en Física (Universidad Estadual de Campinas – Brasil)</p>\r\n<p>Especialista en Ciencia de Materiales (Universidad Central de Caracas – Venezuela)</p>\r\n<p>Licenciado en Física (Universidad Mayor de San Andrés)</p>\r\n<p>Cursos de Formación Académica</p>\r\n<p>Realizó cursos de Postgrado en Ingeniería de Gestión de la Calidad (UPB)</p>\r\n<p>Gestión Universitaria (UAJMS)</p>\r\n<p>Planificación Estratégica Universitaria (UAGRM)</p>\r\n<p>Control Estadístico de Procesos y Métodos Taguchi incluyendo Diseño de Experimentos (UPB – OEA)\r\ny otros en el área de la enseñanza de las ciencias.</p>', '<p>Actual Secretario General de la UPB.</p>\r\n<p>Asesor Principal de Planificación y Evaluación.</p> \r\n<p>Ha conducido los procesos de Certificación de Universidad Plena de la UPB (2001) y de Certificación \r\nISO 9001 (2003-2013).</p>\r\n<p>Como Director de Desarrollo Institucional ha conducido el proceso de Autoestudio Institucional de la \r\nUPB (1997).</p>\r\n<p>Par Evaluador de carreras ingeniería en el marco de acuerdos del MERCOSUR\r\n<p>Especialista en Gestión Universitaria con participación en encuentros hacia la consolidación de la \r\nAgencia Plurinacional de Evaluación y Acreditación de la Educación Superior Universitaria - APEAESU.\r\nDocente de la UPB.</p> \r\n<p>Ha desempeñado la cátedra en diversas asignaturas del área de la Física Clásica y Moderna y también en \r\nel área de la Estadística Aplicada, tanto en pregrado como en postgrado. Fue merecedor de la distinción \r\nde “Docente Buho” otorgado al docente mejor evaluado por los estudiantes de la Facultad de Ingeniería \r\ny Arquitectura –UPB, en la gestión 2002 y también la distinción de “Docente Fundador” por su aporte \r\nacadémico en la formación de estudiante de la UPB desde su apertura como Universidad.</p>\r\n<p>Funciones Ejecutivas en el pasado. </p>\r\n<p>Director Académico de la Facultad de Ciencias y Tecnología - Universidad Mayor de San Simón</p>\r\n<p>Director de la Carrera de Física - Universidad Mayor de San Simón</p>\r\n<p>Secretario Ejecutivo de la Federación Universitaria Docente FCyT - Universidad Mayor de San Simón.</p> \r\n'),
(7, '<p>Marina Y. Nicolaeva</p>', '<p>1997-2001 Doctor en Filosofía (Ph.D.) en Sociología Rural y Demografía, Pennsylvania</p> \r\n<p>1975-1980 Master of Arts en Educación con Especialidades en Geografía y Lengua State</p> \r\n<p>University,  E.E.U.U.: </p>\r\n<p>Inglesa, Universidad Pedagógica Estatal de Moscú – U.R.S.S</p>\r\n', '<p>2012   – presente Vicerrectora de Postgrado. UPB</p>\r\n<p>2006 – 2012 Decana de Postgrado y Directora Académica de la Escuela de Graduados </p>\r\n<p>2003 – 2006 Directora Académica de Postgrado. UPB</p>\r\n<p>2002 – 2003  Docente Investigadora. UPB </p>\r\n<p>2001  Post Doctorado: Investigadora Asociada - Departamento de Economía en Economía y Administración\r\nde Empresas. UPB</p>\r\n<p>1999 – 2001 Asistente de Investigación del Departamento de Economía Agrícola y Agrícola y \r\nSociología Rural e Instituto de Población, Pennsylvania State University – E.E.U.U.</p>\r\n<p>Sociología Rural e Instituto de Población, The Pennsylvania State University – E.E.U.U.</p>\r\n<p>1995 – 1997 Docente de Inglés. UPB – Bolivia </p>\r\n<p>1991 – 1995 Docente de Inglés y Geografía del Turismo de varias entidades educativas</p> \r\n<p>1983 – 1990 Directora del Gabinete Metodológico y Responsable del Laboratorio</p>\r\n<p>1980 – 1983 Profesora de Geografía en las escuelas secundarias  #718, 433 y 343, de Cochabamba – Bolivia</p>\r\n<p>Centro de Ciencias Sociales de la Universidad Estatal de Moscú – URSS</p>'),
(9, 'Elizabeth Miriam Torres Santa Cruz', '<p>Estudió Ingeniera Química en la UMSA y realizó estudios de Maestría en Biotecnología Industrial en la Universidad Católica de Lovaina, Bélgica. Actualmente, está elaborando la tesis doctoral en el Programa de Doctorado en Economía y Administración de Empresas de la Universidad Politécnica de Valencia, España.</p>  \r\n', '<p>Ha trabajado desde1980 hasta 1983 en Destilería Boliviana como Jefe de Calidad y posteriormente, como Jefe de Producción. Desde 1983 y poronce años trabajó en el Programa Agroquímico UMSS-CORDECO, como Técnico Investigador y luego, como Jefe de Proyectos. Forma parte del plantel docente de la Facultad de Ingeniería de la UPB desde 1994 y a partir del año 2001 se desempeña como Jefe de la Carrera Ingeniería de la Producción.</p>'),
(10, 'Gabriel Villegas Aldazosa, Ph.D.c ', '<p>De nacionalidad boliviana, Ph.D. Candidate en Derecho Constitucional (Universidad de Sevilla), Ph.D.</p> \r\n<p>Candidate en Administración de Empresas y Economía (Universidad Politécnica de Valencia),  Máster en Derecho Empresarial (Universidad Los Andes - Colombia), Máster en Derecho Constitucional (Universidad de Sevilla). Licenciado en Derecho (Universidad Católica Boliviana). Actualmente es Decano de la Facultad de Ciencias Empresariales y Derecho de la Universidad Privada Boliviana y profesor Asociado en el ámbito de contratación civil y comercial desde el año 2003 impartiendo docencia a nivel de pregrado como postgrado en la universidad privada y pública.</p>\r\n', '<p>Es investigador y consultor experto en temas referentes a contratación, organización jurídica empresarial e ingeniería legal de negocios, habiendo participado como consultor en el Programa de Saneamiento Legislativo - Área Derecho Civil, Cooperación Técnica Alemana (GTZ) & Vicepresidencia del Estado Plurinacional.</p>\r\n'),
(11, 'Gustavo Zárate', '<p>Economista con una maestría en políticas económicas y sociales en la Universidad Pierre Mendes France (Grenoble-Francia) y una maestría en economía de la energía en la Universidad Montpellier 1(Montpellier-Francia).</p>  <p>Desarrolló su carrera profesional en el ámbito de la energía en el Instituto Francés del Petróleo, UDAPE (Unidad de Análisis de Políticas Económicas y Sociales), YPFB, la Autoridad de Electricidad y el Ministerio de Hidrocarburos y Energía.</p>\r\n', '<p>Adicionalmente es socio fundador del Centro de Desarrollo Económico Comunitario (CEDECO) y facilitador del programa del mismo nombre desde 2011, en coordinación con la Universidad Simon Fraser de Canadá.</p>\r\n<p> Actualmente es jefe de la carrera de economía de la UPB campus La Paz.</p>\r\n'),
(12, 'Carlos Agustín Iturricha Fernández Ph.D.', '<p>Doctor, con distinción Cum Laude, por la Universidad Politécnica de Valencia,España; Doctoren Economía y Administración de Empresas, con Alta Distinción, por la Universidad Privada Boliviana; Master en Administración de Empresas por la Universidad Privada Boliviana; Licenciado en Administración de Empresas por la Universidad Católica de Córdoba – Argentina.</p>\r\n<p>En el ejercicio profesional, especialista en gestión y control administrativo – financiero, mercadeo y comercio exterior.</p>\r\n<p>Experiencia académica, en pregrado, desde el año 1992 al 1997, dictó clases de Sistemas Administrativos en la Universidad Mayor de San Simón de Cochabamba yAdministración de Compras en la Universidad Privada Boliviana.En postgrado desde el año 2003 al presente, dicta materias en la Universidad Privada Boliviana de Mercadeo Estratégico y Gerencia de Ventas, utilizando la metodología de enseñanza basada en el estudio de casos.</p>\r\n<p>Como investigador, realizó investigaciones en mercadeo, capital social y uso de las Tecnologías de Información y Comunicación y la gestión de las organizaciones, con énfasis en la web 2.0.Autor de la tesis doctoral denominada “Efectos de la tecnología web 2.0 en la generación de competencias distintivas: Estudio empírico en empresas del sector metal de España”. Ha disertado artículos en conferencias internacionales como ENEFA - Arica - 2004, SLADE – Santa Cruz -2005, CLADEA – Santiago de Chile 2005 y BALAS – Lima - 2006.</p>\r\n<p>Autor del caso de estudio “Electromec. SRL, ¿cómo enfrentar deudas bancarias con sólo el 50 % de ventas?, publicado en el libro “Gestión estratégica de empresas en Bolivia”, ISBN 848370-296-7\r\nComo consultor, ha asesorado a empresarios en la producción y comercialización de ropa, mermeladas y flores, como también en el rubro de la construcción, farmacéutico y vinícola.</p>', '<p>En la UPB, desde el año 2.001, se desempeñó como Asesor Principal de Marketing Institucional hasta octubre de 2007. Posteriormente ocupa el cargo de Vicerrector Administrativo Financiero hasta el presente.</p>\r\n<p>Consultor en Gestión de Empresas, Mercadeo e Innovación Tecnológica.\r\nEn el rubro automotriz, entre 1998 y 2001, fue Gerente Regional de ToyosaS.A., distribuidor de Toyota para Bolivia y Apoderado de Crown Ltda., distribuidor de vehículos Daithatsu.En el rubro de construcción, fue representante legal de la empresa Constructora Concordia S.A.</p>\r\n<p>En el rubro metal-mecánico entre 1992 al 1998, fue encargado de Comercio Exterior y Adquisiciones en Femco S.R.L.; Administrador y Jefe de Ventas de Industria Metal – Mecánica S.A. \r\nEn la banca, en el año 1991,  fue auxiliar en Comercio Exterior y promotor de tarjetas de crédito VISA en el Banco de Santa Cruz S.A.</p>\r\n'),
(13, 'Hugo Norberto Rojas Salinas ', '<p>Realizó sus estudios universitarios de pregrado en física-matemática en la Universidad de Ginebra-Suiza y obtuvo su doctorado en la misma universidad en el área de física del estado sólido. Posteriormente, trabajo durante dos años en la Universidad de Cambridge-Inglaterra en calidad de Posdoctoral Research Associate.</p> ', '<p>Tiene publicaciones en revista indexadas de física y ha participado en calidad de expositor y expositor invitado en congresos internacionales de Estados Unidos y Europa.</p> \r\n<p>Ha trabajado como Asistente de Cátedra en la Universidad de Ginebra-Suiza y como docente invitado en varias universidades bolivianas. Trabaja en la Universidad Privada Boliviana desde el año 1998 y ha ocupado los cargos de Jefe del Dpto. de Ciencias Exactas, Decano de Posgrado y Decano de Investigación. Actualmente, es Docente Pleno de esta universidad y ocupa el cargo de Vicerrector de Investigación.</p>\r\n');
